<script>
import BGCanvas from './components/BGCanvas.vue'
import ItSpeaks from './components/ItSpeaks.vue'

const colors = ['#00FFFF', '#FF00FF', '#FFFF00', '#00FF00', '#FF0080', '#0080FF'];

export default {
  name: 'App',
  components: {
    BGCanvas,
    ItSpeaks
  },
  mounted() {
    const seraphim = document.getElementById('MAIN-BODY');
    const container = document.getElementById('seraphim-container');

    // Store the center position
    let centerX = 0;
    let centerY = 0;

    // Calculate center on load and resize
    function updateCenter() {
        const rect = container.getBoundingClientRect();
        centerX = rect.left + rect.width / 2;
        centerY = rect.top + rect.height / 2;
    }

    updateCenter();
    window.addEventListener('resize', updateCenter);

    // Track mouse movement
    container.addEventListener('mousemove', (e) => {
        const mouseX = e.clientX;
        const mouseY = e.clientY;
        
        // Calculate distance from center
        const deltaX = mouseX - centerX;
        const deltaY = mouseY - centerY;
        
        // Calculate distance
        const distance = Math.sqrt(deltaX * deltaX + deltaY * deltaY);
        
        // Move away from mouse (inverse direction, scaled down)
        const pushStrength = 190; // How far it moves (in pixels)
        const maxDistance = 400; // Maximum effective distance
        
        const factor = Math.min(distance / maxDistance, 1);
        const moveX = -(deltaX / distance) * pushStrength * factor;
        const moveY = -(deltaY / distance) * pushStrength * factor;
        
        seraphim.style.transform = `translate(${moveX}px, ${moveY}px)`;
    });

    // Return to center when mouse leaves
    container.addEventListener('mouseleave', () => {
        seraphim.style.transform = 'translate(0, 0)';
    });

    // Array of mystical symbols
    const symbols = ['', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''];

    // Function to get the center position of the seraphim
    function getSeraphimCenter() {
        const rect = container.getBoundingClientRect();
        return {
            x: rect.width / 2,
            y: rect.height / 2
        };
    }

    // Function to create and animate a spell symbol
    function castSpell() {
        const center = getSeraphimCenter();
        const symbol = document.createElement('div');
        symbol.className = 'spell-symbol';
        
        // Random symbol from array
        symbol.textContent = symbols[Math.floor(Math.random() * symbols.length)];
        
        // Random color
        symbol.style.color = colors[Math.floor(Math.random() * colors.length)];
        
        // Start from center
        symbol.style.left = center.x + 'px';
        symbol.style.top = center.y + 'px';
        
        // Random direction and distance
        const angle = Math.random() * Math.PI * 2;
        const distance = 150 + Math.random() * 500;
        const tx = Math.cos(angle) * distance;
        const ty = Math.sin(angle) * distance;
        const rotation = Math.random() * 720 - 360;
        
        // Set CSS variables for animation
        symbol.style.setProperty('--tx', `${tx}px`);
        symbol.style.setProperty('--ty', `${ty}px`);
        symbol.style.setProperty('--rotation', `${rotation}deg`);
        
        container.appendChild(symbol);
        
        // Remove element after animation completes
        setTimeout(() => {
            symbol.remove();
        }, 3000);
    }

    // Function to create a burst of symbols
    function symbolBurst() {
        const burstCount = 8 + Math.floor(Math.random() * 8); // 8-15 symbols
        for (let i = 0; i < burstCount; i++) {
            setTimeout(() => {
                castSpell();
            }, i * 50); // Stagger by 50ms
        }
    }

    // Cast spells periodically
    function startCasting() {
        symbolBurst(); // Initial burst
        
        // Random intervals between 3-7 seconds
        const nextCast = 3000 + Math.random() * 4000;
        setTimeout(() => {
            startCasting();
        }, nextCast);
    }

    // Start the spell casting
    startCasting();

    // Optional: Cast on eye blink (sync with blink animation)
    // Trigger when main eye blinks
    setInterval(() => {
        castSpell();
    }, 8000); // Matches the 8s blink cycle

    // Seraphim disappears
    const seraphimContainer = document.querySelector('#seraphim-container');
    let hoverTimer = null;
    let isDisappearing = false;

    seraphimContainer.addEventListener('mouseenter', () => {
        if (isDisappearing) return;
        
        // Start 2-second timer
        hoverTimer = setTimeout(() => {
            // Disappear
            isDisappearing = true;
            seraphimContainer.style.opacity = '0';
            seraphimContainer.style.transition = 'opacity 0.5s ease-out';
            seraphimContainer.style.filter = 'blur(10px)';
            
            // Reappear after 5 seconds
            setTimeout(() => {
                seraphimContainer.style.opacity = '1';
                seraphimContainer.style.transition = 'opacity 1s ease-in';
                seraphimContainer.style.filter = 'blur(0)';
                isDisappearing = false;
            }, 5000);
        }, 2000);
    });

    seraphimContainer.addEventListener('mouseleave', () => {
        // Cancel timer if mouse leaves before 2 seconds
        if (hoverTimer && !isDisappearing) {
            clearTimeout(hoverTimer);
            hoverTimer = null;
        }
    });
    
    // Custom cursor that leaves colored trails
    document.addEventListener('mousemove', (e) => {
        const trail = document.createElement('div');
        trail.style.cssText = `
            position: fixed;
            width: 10px;
            height: 10px;
            border-radius: 50%;
            background: ${colors[Math.floor(Math.random() * colors.length)]};
            left: ${e.clientX}px;
            top: ${e.clientY}px;
            pointer-events: none;
            animation: fade-trail 1s ease-out forwards;
            filter: blur(2px);
        `;
        document.body.appendChild(trail);
        setTimeout(() => trail.remove(), 1000);
    });

    let cloneCount = 0;
    const maxClones = 4;

    document.addEventListener('keydown', (e) => {
        if (e.key === 'Enter' && cloneCount < maxClones) {
            summonClone();
        }
    });

    function summonClone() {
        const original = document.getElementById('seraphim-container');
        const clone = original.cloneNode(true);
        clone.id = `seraphim-clone-${cloneCount}`;
        
        // Random position around the screen
        const angle = (cloneCount / maxClones) * Math.PI * 2;
        const distance = 300;
        const x = Math.cos(angle) * distance;
        const y = Math.sin(angle) * distance;
        
        clone.style.cssText = `
            position: fixed;
            left: 50%;
            top: 50%;
            transform: translate(calc(-50% + ${x}px), calc(-50% + ${y}px)) scale(0);
            opacity: 0;
            animation: clone-appear 1s ease-out forwards;
            filter: hue-rotate(${cloneCount * 72}deg);
        `;
        
        document.body.appendChild(clone);
        cloneCount++;
        
        // After 10 seconds, clones fade away
        setTimeout(() => {
            clone.style.animation = 'clone-disappear 1s ease-out forwards';
            setTimeout(() => {
                clone.remove();
                cloneCount--;
            }, 1000);
        }, 10000);
    }

    // FLIP REALITY 
    document.addEventListener('keydown', (e) => {
        if (e.key === 'Enter') {
            flipReality();
        }
    });

    function flipReality() {
        // Everything inverts - colors, rotation, direction
        document.body.style.animation = 'reality-flip 1s ease-in-out';
        
        // Invert colors
        document.body.style.filter = 'invert(1) hue-rotate(180deg)';
        
        // Flip seraphim
        document.getElementById('MAIN-BODY').style.transform = 'rotateY(180deg)';
        
        // Wings flap opposite direction
        document.getElementById('RIGHT-WING').style.animationDirection = 'reverse';
        document.getElementById('LEFT-WING').style.animationDirection = 'reverse';
        
        // Symbols fly inward instead of outward
        // Background moves opposite
        
        // Press Enter again to restore
        setTimeout(() => {
            document.body.style.filter = '';
            document.getElementById('MAIN-BODY').style.transform = '';
        }, 5000);
      }

    let dimension = 0;
    const dimensions = [
        { name: 'Material Realm', filter: '' },
        { name: 'Shadow Realm', filter: 'grayscale(1) contrast(1.5)' },
        { name: 'Dream Realm', filter: 'hue-rotate(180deg) saturate(2)' },
        { name: 'Void Realm', filter: 'invert(1) contrast(2)' },
        { name: 'Crystal Realm', filter: 'brightness(1.5) saturate(3)' }
    ];

    document.addEventListener('keydown', (event) => {
        if (event.key === 'ArrowRight' || event.code === 'ArrowRight') {
            shiftDimension();
        }
    });

    function shiftDimension() {
        dimension = (dimension + 1) % dimensions.length;
        const current = dimensions[dimension];
        
        // Flash effect
        document.body.style.background = 'white';
        setTimeout(() => {
            document.body.style.background = '';
        }, 100);
        
        // Apply dimension filter
        document.body.style.filter = current.filter;
        
        // Announce dimension
        const announcement = document.createElement('div');
        announcement.textContent = ` ${current.name} `;
        announcement.style.cssText = `
            position: fixed;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 36px;
            color: white;
            font-weight: bold;
            text-shadow: 0 0 20px currentColor;
            animation: fade-out 2s ease-out forwards;
            pointer-events: none;
            z-index: 1000;
        `;
          document.body.appendChild(announcement);
          setTimeout(() => announcement.remove(), 2000);
        }
      }
}
</script>

